// ==UserScript==
// @name         MSBing Clock
// @namespace    https://sites.google.com/view/voltaccept/
// @version      v0.0.1
// @description  Lets You See Time and Date of Your Region in Microsoft's Search Engine, Bing.
// @author       VoltacceptYT (VoidDrifter)
// @match        https://www.bing.com/search?*
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==

//Set Elements
var centerElement = document.createElement("center");
var clockElement = document.createElement("H1");
var footerFrame = document.querySelector("#b_footer");

//Set Positions
footerFrame.appendChild(centerElement);
centerElement.appendChild(clockElement);

//Set Styles
clockElement.style.backgroundColor = "rgb(245, 245, 245)";
clockElement.style.fontWeight = "500";
clockElement.style.fontSize = "14px";
clockElement.style.paddingTop = "5px";
clockElement.style.paddinBottom = "10px";

//Set Placeholders
clockElement.innerText = Date().toString();

//Main Function
function time() {
    clockElement.innerText = Date().toString();
}

//Main Script
setInterval(time, 1000);